import React from 'react';
import './LeftNavBar.css';

const LeftNavBar = () => {
  return (
    <div className="left-navbar">
        <ul>
            <li>
                <img className="dashboard" src="https://img.icons8.com/clouds/512/speed.png"></img>Dashboard</li>
            <li className="game-plan">Game Plan</li>
            <li className="levels">Levels</li>

        </ul>
    </div>
  )
}

export default LeftNavBar
